import React from 'react';
import { Smartmobile } from "./styles/Login";
import { StatusBar } from 'expo-status-bar';

const Login = () => {
    return (
        <View>
        <Text> SmartMobile </Text>
        <StatusBar style="auto" />
      </View>
    );
  }
  
  export default Login;
